import { useCallback, useState } from "react"
import styled from "styled-components"
import axios from "axios"
import { useNavigate } from "react-router-dom"
import { propsType } from "../../components/signup/propsType"

const SignUpBtn = ({memberId, password, name, email, phone, address, extraAddress, checked, birth }: propsType) => {
  const navigate = useNavigate();
  
  const [submit, setSubmit] = useState(false);

  const register = () => {
    setSubmit(true);
  }

  const onSubmit = useCallback(
    async (e: React.FormEvent<HTMLFormElement>) => {
      e.preventDefault()
      try {
        await axios
          .post('/signup', {
            memberId: memberId,
            password: password,
            name: name,
            email: email,
            mobileNumber: phone,
            address: address,
            extraAddress: extraAddress,
            gender: checked,
            birth: birth,
          })
          .then((res) => {
            console.log('response:', res)
            if (res.status === 200) {
              navigate('./signup/success');
            }
          })
      } catch (err) {
        console.error(err)
      }
    },
    [memberId, password, name, email, phone, address, extraAddress, checked, birth]
  )
  return (
    <SignUpButton type="submit" onClick={onSubmit}>
      <span>가입하기</span>
    </SignUpButton>
  )

}

export default SignUpBtn

const SignUpButton = styled.button`
  display: block;
  padding: 0px 10px;
  text-align: center;
  overflow: hidden;
  width: 240px;
  height: 56px;
  border-radius: 3px;
  color: rgb(255, 255, 255);
  background-color: rgb(95, 0, 128);
  border: 0px none;
  span {
    display: inline-block;
    font-size: 16px;
    font-weight: 500;
  }
`
